window.bookSummaryJSON = "<p><b>\"You're nothing. Just a nobody that wasn't wanted.\"</b></p> <p>Those words have played in my head since I was five years old.</p> <p>Every night, when I close my eyes, I relive that moment. The heat, the smoke, and the cruel smile on her face. For the longest time, I believed them. All I wanted was to find a place to belong, to be needed. But who could ever need me, a prey shifter? How can a rabbit be useful, especially when I lack elemental magic?</p> <p>The guys saved me that night and every day since. They refused to let me feel useless, instead teaching me to be strong and use what I thought was a weakness to my advantage. With Lyle, Blair, Pike, and the twins, Sol and Storm, I found what I never thought was possible. People who wanted me, people who value me. They may be Alpha predators, but they make me feel like I belong.</p> <p>I found a pack.</p> <p>But nothing is forever, and one day, I'll have to watch them leave to pick mates to spend their lives with. The thought haunts me, but I can't let it rule my life.</p> <p>I don't want to be alone, not again...</p> <p>Again?</p> <p>Sometimes, my thoughts are not my own. I feel like someone else lives inside of me, full of pain. While I don't know the reason for the pain, I can feel it as if it is my own. Every day, the feeling is stronger, and with it comes chaos. My life has become a delicate balance, and something inside of me can't wait for it to snap.</p> <p>Fear keeps me holding onto what I know. Whatever is inside of me is waiting to get out, but it's dark and dangerous, and I refuse to let those around me be hurt by it.</p> <p>I'm just not sure I can hold it in much longer.</p> <p>Shaped by Destiny <i>is book one in the Beasts of Extinction Series and ends on a cliffhanger. This is a full-length shifter romance that has some darker elements. For mature listeners.</i></p>"; 
